import Layout from "../components/Layout";
import cephalopods from "../image/welcome.png";

function MyPngs() {
    return (
        <div className="MyPngs">
            <Layout>
                <h1 className="text-6xl text-center text-6xl hover:transition ease-in-out delay-150 hover:-translate-y-1 hover:scale-110 duration-300">Images</h1>

                <div className="flex flex-wrap">
                    <img className="h-12" src={cephalopods} alt="Logo"/>
                </div>
            </Layout>
        </div>
    );
}

export default MyPngs;
